🎉
The #SPoTTampa crew went to Bradenton Riverwalk Skatepark to watch our friend @jakeilardi turn PRO for @blindskate today!
🎉
A bunch of friends & family got together to surprise him and we were lucky enough to be invited to join the celebration! 
🎉
Despite some typical Florida weather, we all came together to show love, scream our heads off, eat cake, sip champagne & even managed to skate a little bit...CONGRATULATIONS AGAIN JAKE! You earned it!
💯 
Featuring:
@jakeilardi 
@tjrogers 
