Yesterday we surprised @_itskris_ with a special 21st Birthday Party at SPoT. Kris basically grew up and definitely learned to skate here so we wanted to do something special. We invited his family & friends to come celebrate over good food, good conversation & amazing skating. Enjoy this video & be sure to wish Kris a very happy birthday! 
