On Friday @brianschaefer rallied the SPoT Squad together for an afternoon session at the historic Bro Bowl Skatepark. @sambellipanni brought out some of his own obstacles to make things a little more interesting & the crew brought their good energy to make the session feel extra special. 
.
Enjoy this video & have a great weekend everyone!
